import React from "react";
import { useState } from "react";
import Sidebar from "./Sidebar";
import TaskPlacement from "./TaskPlacement";
import TaskForm from "../Components/TaskForm";
import Navbar from "./Navbar";
export default function parentComponent() {
	const [visibility, setFormVisibility] = useState(false);

	const toggleVisibility = () => {
		return setFormVisibility((prevVisibility) => !prevVisibility);
	};

	return (
		<div>
			<Navbar>Task M</Navbar>
			<Sidebar toggleVisibility={toggleVisibility}></Sidebar>
			<TaskPlacement>{visibility && <TaskForm />}</TaskPlacement>
		</div>
	);
}
